import React from 'react';

const Footer = () => {
    return (
        <footer>
            <div className="container">
                Designing &amp; Programming by <img src="/images/logo.png" alt="web injaz" /> <a href="http://webinjaz.com">Web Injaz</a>
            </div>
        </footer>
    );
};

export default Footer;
